import React from 'react';

class FirstInput extends React.Component {
    constructor(props){
        super(props)
        this.state.num1 = props.num1
    }
    render(props) {
        return (
            <div>
                <button onClick={props.handleNum1Change} value="1" className="btn btn-dark m-1 btn-lg">1</button>
                <button onClick={props.handleNum1Change} value="2" className="btn btn-dark m-1 btn-lg">2</button>
                <button onClick={props.handleNum1Change} value="3" className="btn btn-dark m-1 btn-lg">3</button>
                <br />
                <button onClick={props.handleNum1Change} value="4" className="btn btn-dark m-1 btn-lg">4</button>
                <button onClick={props.handleNum1Change} value="5" className="btn btn-dark m-1 btn-lg">5</button>
                <button onClick={props.handleNum1Change} value="6" className="btn btn-dark m-1 btn-lg">6</button>
                <br />
                <button onClick={props.handleNum1Change} value="7" className="btn btn-dark m-1 btn-lg">7</button>
                <button onClick={props.handleNum1Change} value="8" className="btn btn-dark m-1 btn-lg">8</button>
                <button onClick={props.handleNum1Change} value="9" className="btn btn-dark m-1 btn-lg">9</button>
                <br />
                <button onClick={props.handleNum1Change} value="0" className="btn btn-dark m-1 btn-lg">0</button>
                <button onClick={props.handleNum1Change} value="." className="btn btn-dark m-1 btn-lg">.</button>
            </div>
        )
    }
}
export default FirstInput
